import React from 'react';
import './App.css';
import { Button } from '@material-ui/core';

function RandButton(Number) {

    const Random = null;

    function Roll() {
        const min = 1;
        const max = Number;
        const rand = min + Math.random() * (max - min);
        console.log(rand);
    }

    return (
            <Button variant="outlined" onClick={() => Roll()}> Click me! </Button>
        
    );
}
export default RandButton;
